import React from 'react';
import './App.css';
import Sidebar from './components/Sidebar'
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Project_Status from './pages/Project Status';
import Home from './pages/Home';
import Update_Employee from './pages/Update Employee';
import Remove_Employee from './pages/Remove Employee';

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Sidebar>
          <Routes>
            <Route path='/Home' element={<Home />}></Route>
            <Route path='/ProjectStatus' element={<Project_Status />}></Route>
            <Route path='/UpdateEmployee' element={<Update_Employee />}></Route>
            <Route path='/RemoveEmployee' element={<Remove_Employee />}></Route>
            {/* <Route path='/' element={</>}></Route> */}
          </Routes>
        </Sidebar>
      </BrowserRouter>
    </div>
  )
}

export default App;
